import React from 'react';

function Suspendable() {
    return <div>Finished Loading!</div>;
}

export default Suspendable;

import React from 'react';
import './App.css';

const Suspendable = React.lazy(() => import('./Suspendable'));

function App() {
    return (
        <div className="App">
            <React.Suspense fallback="Loading...">
                <Suspendable />
            </React.Suspense>
        </div>
    );
}

export default App;
